import {BrowserRouter, Switch, Route} from 'react-router-dom';
import App from './App';
import FriendList from '.FriendList';

function Router() {

    return (
<BrowserRouter>
<Switch>
    <Route path="/friend-list">
            <FriendList />
    </Route>
    <Route part="/">
    <App />
    </Route>
</Switch>
</BrowserRouter>
        
    )
}

export default Router;
